import React from "react";
import './content.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCircleDollar } from '@fortawesome/free-solid-svg-icons'; // Change to solid if that's the icon you want




function Content() {
    return (
        <div className="content">
            <div>
                <FontAwesomeIcon icon="fa-regular fa-face-smile" />
                <FontAwesomeIcon icon="fa-solid fa-timer" />
                <FontAwesomeIcon icon={faCircleDollar} />
            </div>
        </div>
    );
}

export default Content;
